import React, { Component } from 'react';
import HeadLogo from './HeadLogo';
import bootstrap from 'bootstrap';

class App extends Component {
  render() {
    return (
      <div className="jumbotron">
        <HeadLogo />
        <button className="btn">asd</button>
      </div>
    );
  }
}

export default App;
